commits.content:
.info_2116 {
    zoom: 1;
}

.info_2116 li {
    float: left;
    width: 179px;
    height: 48px;
    background: url("../images/ani_btn.png");
    position: relative;
    list-style-type: none;
}

* html .info_2116 li {
    display: inline;
    zoom: 1;
}

*+html .info_2116 li {
    display: inline;
    zoom: 1;
}

.info_2116 li a {
    display: block;
    width: 100%;
    height: 100%;
    line-height: 48px;
    text-indent: 30px;
    font-weight: bold;
    color: #CFDFB5;
    text-decoration: none;
    position: relative;
}

.info_2116 li a:hover {
    background: url("../images/ani_btn_over.png");
}

.info_2116 ul.sub2 {
    display: none;
}

* html .info_2116 ul.sub2 {
    zoom: 1;
    position: relative;
}

*+html .info_2116 ul.sub2 {
    zoom: 1;
    position: relative;
}

.info_2116 ul.sub2 li {
    float: none;
}

.info_2116 ul.sub2 li ul.sub2 {
    position: absolute;
    left: 179px;
    top: 0;
}

.info_2116:after {
    height: 0;
    visibility: hidden;
    content: ".";
    display: block;
    clear: both;
}
